import './App.scss'
import ProductsPage from './products/productsPage'
import { BrowserRouter as Router, Route, Switch } from "react-router-dom"

function App() {
	return (
		<Router>
			<div className="App">
				<Routes>
					<Route path="/products" component={ProductsPage} />
				</Routes>
			</div>
		</Router>
	);
}

export default App;
